function clickStart(){(!userId()||confirm("Are you sure you want to reset the user ID?"))&&startGetData("/api/experiment/user/new",function(n){userId(n);goUrl("/experiment")},function(n,t){alertError("An error occured while starting the experiment.\nSTATUS: "+t)})}$(document).ready(function(){userId()&&startPostData("/api/experiment/user/exists",function(n){logd("user exists response: "+n);var t=n.toLowerCase()==="true";t?(logi("user id exists in server, continuing..."),alert("An experiment is already progress, redirecting..."),goUrl("/experiment")):(logi("user id does not exist in server, resetting..."),userIdReset())},function(n,t){alertError("Unable to connect to server, status:\n"+t)},{id:userId()})});